import './App.css';
import FuelQuoteForm from './FuelQuoteForm';
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <h1>CS4353 Web App</h1>

      <Router>
        {/* Navigation bar */}
        <nav>
          <ul>
            {/* Navigation link to the home page */}
            <li>
              <NavLink to="/" style={({ isActive }) => ({ color: isActive ? 'red' : 'blue' })}>
                Home
              </NavLink>
            </li>
            {/* Navigation link to the Fuel Quote Form */}
            <li>
              <NavLink to="/fuel-quote-form" style={({ isActive }) => ({ color: isActive ? 'red' : 'blue' })}>
                Fuel Quote Form
              </NavLink>
            </li>
          </ul>
        </nav>

        {/* Routes */}
        <Routes>
          <Route exact path="/fuel-quote-form" element={<FuelQuoteForm />} />
          {/* You can add a Route for the home page or other components as needed */}
        </Routes>
      </Router>
    </div>
  );
}


export default App;
